import React, { useState } from 'react';
import './Body.css';
import Welcome from './Welcome.tsx';
import Overview from './Overview.tsx';

// Define WelcomeProps interface outside of the Body component
interface WelcomeProps {
  func: () => JSX.Element;
}

function Body() {
  const [displayHelper, setHelperDisplay] = useState(false);

  function handleHelperDisplay() {
    setHelperDisplay(!displayHelper);
    console.log(displayHelper);
    return displayHelper;
  }

  const props = {
    changeHelperDisplay: handleHelperDisplay,
  };

  console.log({...props});

  return (
    <div className="Body">
      <Welcome func={handleHelperDisplay}></Welcome>
      <Overview></Overview>
    </div>
  );
}

export default Body;
